import { IonContent, IonHeader, IonPage, IonTitle, IonToolbar, IonList, IonItem, IonLabel, IonCheckbox, IonBadge, IonFab, IonFabButton, IonIcon, useIonViewDidEnter } from '@ionic/react';
import React, { useState, useEffect, } from 'react';
import { add } from 'ionicons/icons';
import { RouteComponentProps } from 'react-router';
import axios from 'axios';



const Home: React.FC<RouteComponentProps> = (props) => {
  const [tasks, setData] = useState([]);


  useIonViewDidEnter(() => {
    useEffect(() => {
      axios({
        "method": "GET",
        "url": "http://localhost:3000/tasks",
      }).then(res => {
        setData(res.data);
      }).catch((error) => {
        console.log(error)
      })
    })
  })

  return (
    <IonPage>

      <IonHeader>
        <IonToolbar>
          <IonTitle>Listando suas tarefas</IonTitle>
        </IonToolbar>
      </IonHeader>
      <IonContent>

        <IonList>
          <IonItem>
            <IonCheckbox slot="start" />

            <IonLabel>
              This is a not for example
            </IonLabel>
            <IonBadge color="warning" slot="end">
              Priority: 3
            </IonBadge>
          </IonItem>
        </IonList>

      </IonContent>

      <IonFab vertical="bottom" horizontal="end" slot="fixed">
        <IonFabButton onClick={() => props.history.push('/newTask')}>
          <IonIcon icon={add} />
        </IonFabButton>
      </IonFab>

    </IonPage>
  );
};

export default Home;
